@@ -0,0 +1,334 @@
+.propslidersection {
+    padding-top: 90px;
+}
+
+.property-slider {
+    .imgwrap {
+        border-radius: 16px;
+        position: relative;
+        overflow: hidden;
+        height: 600px;
+
+        img {
+            vertical-align: top;
+            width: 100%;
+            height: 100%;
+            object-fit: cover;
+            object-position: 50% 50%;
+        }
+    }
+
+    .swiper-button-next,
+    .swiper-button-prev {
+        width: 70px;
+        height: 70px;
+
+        &::after {
+            display: none;
+        }
+    }
+
+    .swiper-button-prev {
+        display: none;
+    }
+
+    .swiper-button-next {
+        right: 16px;
+    }
+}
+
+.property-infosect {
+    padding: 32px 0 40px;
+}
+
+.property-infosect__header {
+    padding-bottom: 24px;
+    border-bottom: 1px solid rgba(#000000, 0.12);
+    max-width: 700px;
+
+    .title {
+        @include h3;
+        color: var(--primary);
+        margin-bottom: 16px;
+
+        span {
+            @include body1;
+            display: inline-block;
+            margin-left: 20px;
+            color: rgba(#000, 0.6);
+            vertical-align: middle;
+        }
+    }
+
+    ul {
+        list-style-type: none;
+
+        li {
+            margin-bottom: 26px;
+            position: relative;
+            padding-left: 32px;
+            @include h5;
+            color: var(--primary);
+
+            &:last-child {
+                margin-bottom: 0;
+            }
+
+            img {
+                width: 24px;
+                position: absolute;
+                left: 0;
+                top: 50%;
+                transform: translateY(-50%);
+                margin-top: -1px;
+            }
+        }
+    }
+}
+
+.property-infosect__descr {
+    max-width: 700px;
+    padding: 40px 0;
+
+    p {
+        @include body1;
+        margin-bottom: 20px;
+
+        &:last-child {
+            margin-bottom: 0;
+        }
+    }
+}
+
+.goback {
+    @include h5;
+    color: var(--primary);
+    display: inline-flex;
+    align-items: center;
+    transition: 0.3s;
+
+    img {
+        margin-right: 8px;
+        width: 40px;
+        transition: 0.3s;
+        filter: brightness(0);
+    }
+
+    &:hover {
+        color: var(--accent);
+
+        img {
+            filter: brightness(1);
+        }
+    }
+}
+
+.property-infosect__right {
+    border-top: 1px solid rgba(#000000, 0.12);
+
+    ul {
+        list-style-type: none;
+        border-bottom: 1px solid rgba(#000000, 0.12);
+        padding: 24px 0;
+
+        li {
+            display: flex;
+            flex-wrap: wrap;
+            margin-bottom: 24px;
+            align-items: center;
+
+            &:last-child {
+                margin-bottom: 0;
+            }
+
+            img {
+                width: 100%;
+                max-width: 40px;
+                flex: 0 0 40px;
+            }
+
+            span {
+                @include h5;
+                color: var(--primary);
+                padding-left: 8px;
+            }
+        }
+    }
+}
+
+.property-enquiry {
+    padding: 60px 0 40px;
+
+    .contactsection__left ul li {
+        margin-bottom: 16px;
+    }
+}
+
+.peimg {
+    border-radius: 12px;
+    margin-bottom: 16px;
+}
+
+.similarprop {
+    padding: 60px 0 100px;
+}
+
+.similarprop__head {
+    display: flex;
+    flex-wrap: wrap;
+    margin-bottom: 32px;
+
+    .title {
+        width: 100%;
+        max-width: calc(100% - 70px);
+        flex: 0 0 calc(100% - 70px);
+        @include h1;
+        color: var(--primary);
+    }
+
+    .headsliderarrow {
+        width: 100%;
+        max-width: 70px;
+        flex: 0 0 70px;
+
+        img {
+            vertical-align: top;
+        }
+    }
+
+    .swiper-button-next-t,
+    .swiper-button-next-t {
+        cursor: pointer;
+        filter: brightness(0);
+        transition: 0.5s;
+
+        &:hover {
+            filter: brightness(1);
+        }
+    }
+}
+
+.similarprop__head .headsliderarrow img {
+    width: 70px;
+}
+
+@media(max-width:1439.8px) {
+    .similarprop__head .title {
+        font-size: 40px;
+    }
+}
+
+@media(max-width:1399.8px) {
+    .property-slider .imgwrap {
+        height: 500px;
+    }
+
+    .similarprop__head .headsliderarrow img {
+        width: 50px;
+    }
+
+    .headsliderarrow {
+        text-align: right;
+    }
+}
+
+@media(max-width:1199.8px) {
+    .property-slider .imgwrap {
+        height: 400px;
+    }
+
+    .property-infosect__descr {
+        padding: 30px 0;
+    }
+
+    .property-infosect__right ul li {
+        margin-bottom: 16px;
+    }
+
+    .property-infosect,
+    .property-enquiry {
+        padding-bottom: 10px;
+    }
+
+    .similarprop {
+        padding-bottom: 70px;
+    }
+}
+
+@media(max-width:991.8px) {
+    .peimg {
+        width: 100%;
+    }
+
+    .similarprop__head .title {
+        font-size: 32px;
+    }
+
+    .property-slider .imgwrap,
+    .formdark,
+    .objectcard {
+        border-radius: 8px;
+    }
+}
+
+@media(max-width:767.8px) {
+
+    .property-slider .swiper-button-next,
+    .property-slider .swiper-button-prev {
+        width: 50px;
+        height: 50px;
+    }
+
+    .property-slider .swiper-button-next {
+        right: 10px;
+    }
+
+
+
+
+
+}
+
+@media(max-width:575.8px) {
+    .property-slider .imgwrap {
+        height: 250px;
+    }
+
+    .property-infosect__header .title {
+        font-size: 24px;
+
+        span {
+            font-size: 12px;
+            margin-left: 10px;
+        }
+    }
+
+    .property-infosect__header ul li {
+        font-size: 16px;
+        margin-bottom: 15px;
+    }
+
+    .property-infosect__header {
+        padding-bottom: 20px;
+    }
+
+    .property-infosect__descr {
+        padding: 20px 0;
+    }
+
+    .property-infosect {
+        padding: 20px 0 20px;
+    }
+
+    .property-enquiry {
+        padding-top: 20px;
+    }
+
+
+
+
+
+
+
+
+}
